import './logout.css'

export default function Logout(props) {
    let url = "http://ufrj.br";

    return (
        <div onClick={() => props.clickHandler()}>
            <a href={url}>{props.language==="PORT"?"Logout":"Sair"}</a>
        </div>
    );
}
